import { __decorate } from "tslib";
import __NG_CLI_RESOURCE__0 from "./board-admin.component.html?ngResource";
import __NG_CLI_RESOURCE__1 from "./board-admin.component.css?ngResource";
import { Component } from '@angular/core';
import { AuthService } from '../../services/auth.service';
let BoardAdminComponent = class BoardAdminComponent {
    constructor(authService) {
        this.authService = authService;
        this.form = {
            username: null,
            email: null,
            password: null
        };
        this.isSuccessful = false;
        this.isSignUpFailed = false;
        this.errorMessage = '';
        this.film = {
            filmname: null,
            desc: null,
            gender: null,
            image: null
        };
    }
    ngOnInit() {
    }
    onSubmit() {
        const { username, email, password } = this.form;
        this.authService.register(username, email, password).subscribe({
            next: data => {
                console.log(data);
                this.isSuccessful = true;
                this.isSignUpFailed = false;
            },
            error: err => {
                this.errorMessage = err.error.message;
                this.isSignUpFailed = true;
            }
        });
    }
};
BoardAdminComponent.ctorParameters = () => [
    { type: AuthService }
];
BoardAdminComponent = __decorate([
    Component({
        selector: 'app-board-admin',
        template: __NG_CLI_RESOURCE__0,
        styles: [__NG_CLI_RESOURCE__1]
    })
], BoardAdminComponent);
export { BoardAdminComponent };
